import logo from './logo.svg';
import './App.css';
import Menu from "./components/Menu";
import { Container, Row ,Col} from 'reactstrap';
import Header from "./components/Header";
import Home from './components/Home'

function App() {
  return (
    <div >
      <Container>
        <Header />
        <Row>
          <Col md={4}>
            <Menu />
            </Col>
          <Col md={8}>
            <Home />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
